FROM (SELECT "ADS"."KEY" AS "KEY", "SV_data_3".dual_coeff * exp(CASE WHEN (-0.05 * (power("ADS"."Feature_0" - "SV_data_3".sv_0, 2) + power("ADS"."Feature_1" - "SV_data_3".sv_1, 2) + power("ADS"."Feature_2" - "SV_data_3".sv_2, 2) + power("ADS"."Feature_3" - "SV_data_3".sv_3, 2) + power("ADS"."Feature_4" - "SV_data_3".sv_4, 2) + power("ADS"."Feature_5" - "SV_data_3".sv_5, 2) + power("ADS"."Feature_6" - "SV_data_3".sv_6, 2) + power("ADS"."Feature_7" - "SV_data_3".sv_7, 2) + power("ADS"."Feature_8" - "SV_data_3".sv_8, 2) + power("ADS"."Feature_9" - "SV_data_3".sv_9, 2) + power("ADS"."Feature_10" - "SV_data_3".sv_10, 2) + power("ADS"."Feature_11" - "SV_data_3".sv_11, 2) + power("ADS"."Feature_12" - "SV_data_3".sv_12, 2) + power("ADS"."Feature_13" - "SV_data_3".sv_13, 2) + power("ADS"."Feature_14" - "SV_data_3".sv_14, 2) + power("ADS"."Feature_15" - "SV_data_3".sv_15, 2) + power("ADS"."Feature_16" - "SV_data_3".sv_16, 2) + power("ADS"."Feature_17" - "SV_data_3".sv_17, 2) + power("ADS"."Feature_18" - "SV_data_3".sv_18, 2) + power("ADS"."Feature_19" - "SV_data_3".sv_19, 2)) >= -709.782712893) THEN -0.05 * (power("ADS"."Feature_0" - "SV_data_3".sv_0, 2) + power("ADS"."Feature_1" - "SV_data_3".sv_1, 2) + power("ADS"."Feature_2" - "SV_data_3".sv_2, 2) + power("ADS"."Feature_3" - "SV_data_3".sv_3, 2) + power("ADS"."Feature_4" - "SV_data_3".sv_4, 2) + power("ADS"."Feature_5" - "SV_data_3".sv_5, 2) + power("ADS"."Feature_6" - "SV_data_3".sv_6, 2) + power("ADS"."Feature_7" - "SV_data_3".sv_7, 2) + power("ADS"."Feature_8" - "SV_data_3".sv_8, 2) + power("ADS"."Feature_9" - "SV_data_3".sv_9, 2) + power("ADS"."Feature_10" - "SV_data_3".sv_10, 2) + power("ADS"."Feature_11" - "SV_data_3".sv_11, 2) + power("ADS"."Feature_12" - "SV_data_3".sv_12, 2) + power("ADS"."Feature_13" - "SV_data_3".sv_13, 2) + power("ADS"."Feature_14" - "SV_data_3".sv_14, 2) + power("ADS"."Feature_15" - "SV_data_3".sv_15, 2) + power("ADS"."Feature_16" - "SV_data_3".sv_16, 2) + power("ADS"."Feature_17" - "SV_data_3".sv_17, 2) + power("ADS"."Feature_18" - "SV_data_3".sv_18, 2) + power("ADS"."Feature_19" - "SV_data_3".sv_19, 2)) ELSE -709.782712893 END) AS dot_prod1 
FROM "INPUT_DATA" AS "ADS", "SV_data_3") AS full_join_data_sv GROUP BY full_join_data_sv."KEY") AS t), 
"OVR_Join_CTE" AS 
(SELECT kernel_cte_0."KEY_0" AS "KEY_0", kernel_cte_0."Score_0" AS "Score_0", kernel_cte_1."KEY_1" AS "KEY_1", kernel_cte_1."Score_1" AS "Score_1", kernel_cte_2."KEY_2" AS "KEY_2", kernel_cte_2."Score_2" AS "Score_2", kernel_cte_3."KEY_3" AS "KEY_3", kernel_cte_3."Score_3" AS "Score_3" 
FROM kernel_cte_0 LEFT OUTER JOIN kernel_cte_1 ON kernel_cte_0."KEY_0" = kernel_cte_1."KEY_1" LEFT OUTER JOIN kernel_cte_2 ON kernel_cte_2."KEY_2" = kernel_cte_1."KEY_1" LEFT OUTER JOIN kernel_cte_3 ON kernel_cte_3."KEY_3" = kernel_cte_2."KEY_2"), 
orig_cte AS 
(SELECT "OVR_Join_CTE"."KEY_0" AS "KEY", "OVR_Join_CTE"."Score_0" AS "Score_0", "OVR_Join_CTE"."Score_1" AS "Score_1", "OVR_Join_CTE"."Score_2" AS "Score_2", "OVR_Join_CTE"."Score_3" AS "Score_3", CAST(NULL AS FLOAT(53)) AS "Proba_0", CAST(NULL AS FLOAT(53)) AS "Proba_1", CAST(NULL AS FLOAT(53)) AS "Proba_2", CAST(NULL AS FLOAT(53)) AS "Proba_3", CAST(NULL AS FLOAT(53)) AS "LogProba_0", CAST(NULL AS FLOAT(53)) AS "LogProba_1", CAST(NULL AS FLOAT(53)) AS "LogProba_2", CAST(NULL AS FLOAT(53)) AS "LogProba_3", CAST(NULL AS FLOAT(53)) AS "Decision" 
FROM "OVR_Join_CTE"), 
score_class_union AS 
(SELECT scu."KEY" AS "KEY", scu.class AS class, scu."LogProba" AS "LogProba", scu."Proba" AS "Proba", scu."Score" AS "Score" 
FROM (SELECT orig_cte."KEY" AS "KEY", 0 AS class, orig_cte."LogProba_0" AS "LogProba", orig_cte."Proba_0" AS "Proba", orig_cte."Score_0" AS "Score" 
FROM orig_cte UNION ALL SELECT orig_cte."KEY" AS "KEY", 1 AS class, orig_cte."LogProba_1" AS "LogProba", orig_cte."Proba_1" AS "Proba", orig_cte."Score_1" AS "Score" 
FROM orig_cte UNION ALL SELECT orig_cte."KEY" AS "KEY", 2 AS class, orig_cte."LogProba_2" AS "LogProba", orig_cte."Proba_2" AS "Proba", orig_cte."Score_2" AS "Score" 
FROM orig_cte UNION ALL SELECT orig_cte."KEY" AS "KEY", 3 AS class, orig_cte."LogProba_3" AS "LogProba", orig_cte."Proba_3" AS "Proba", orig_cte."Score_3" AS "Score" 
FROM orig_cte) AS scu), 
score_max AS 
(SELECT orig_cte."KEY" AS "KEY", orig_cte."Score_0" AS "Score_0", orig_cte."Score_1" AS "Score_1", orig_cte."Score_2" AS "Score_2", orig_cte."Score_3" AS "Score_3", orig_cte."Proba_0" AS "Proba_0", orig_cte."Proba_1" AS "Proba_1", orig_cte."Proba_2" AS "Proba_2", orig_cte."Proba_3" AS "Proba_3", orig_cte."LogProba_0" AS "LogProba_0", orig_cte."LogProba_1" AS "LogProba_1", orig_cte."LogProba_2" AS "LogProba_2", orig_cte."LogProba_3" AS "LogProba_3", orig_cte."Decision" AS "Decision", (SELECT max(score_class_union."LogProba") AS max_1 
FROM score_class_union 
WHERE orig_cte."KEY" = score_class_union."KEY") AS "max_LogProba", (SELECT max(score_class_union."Proba") AS max_2 
FROM score_class_union 
WHERE orig_cte."KEY" = score_class_union."KEY") AS "max_Proba", (SELECT max(score_class_union."Score") AS max_3 
FROM score_class_union 
WHERE orig_cte."KEY" = score_class_union."KEY") AS "max_Score" 
FROM orig_cte), 
arg_max_cte AS 
(SELECT score_max."KEY" AS "KEY", score_max."Score_0" AS "Score_0", score_max."Score_1" AS "Score_1", score_max."Score_2" AS "Score_2", score_max."Score_3" AS "Score_3", score_max."Proba_0" AS "Proba_0", score_max."Proba_1" AS "Proba_1", score_max."Proba_2" AS "Proba_2", score_max."Proba_3" AS "Proba_3", score_max."LogProba_0" AS "LogProba_0", score_max."LogProba_1" AS "LogProba_1", score_max."LogProba_2" AS "LogProba_2", score_max."LogProba_3" AS "LogProba_3", score_max."Decision" AS "Decision", score_max."max_LogProba" AS "max_LogProba", score_max."max_Proba" AS "max_Proba", score_max."max_Score" AS "max_Score", (SELECT min(score_class_union.class) AS min_1 
FROM score_class_union 
WHERE score_max."max_LogProba" = score_class_union."LogProba" AND score_max."KEY" = score_class_union."KEY") AS "arg_max_LogProba", (SELECT min(score_class_union.class) AS min_2 
FROM score_class_union 
WHERE score_max."max_Proba" = score_class_union."Proba" AND score_max."KEY" = score_class_union."KEY") AS "arg_max_Proba", (SELECT min(score_class_union.class) AS min_3 
FROM score_class_union 
WHERE score_max."max_Score" = score_class_union."Score" AND score_max."KEY" = score_class_union."KEY") AS "arg_max_Score" 
FROM score_max)
 SELECT arg_max_cte."KEY" AS "KEY", arg_max_cte."Score_0" AS "Score_0", arg_max_cte."Score_1" AS "Score_1", arg_max_cte."Score_2" AS "Score_2", arg_max_cte."Score_3" AS "Score_3", arg_max_cte."Proba_0" AS "Proba_0", arg_max_cte."Proba_1" AS "Proba_1", arg_max_cte."Proba_2" AS "Proba_2", arg_max_cte."Proba_3" AS "Proba_3", CASE WHEN (arg_max_cte."Proba_0" IS NULL OR arg_max_cte."Proba_0" > 0.0) THEN ln(arg_max_cte."Proba_0") ELSE -1.79769313486231e+308 END AS "LogProba_0", CASE WHEN (arg_max_cte."Proba_1" IS NULL OR arg_max_cte."Proba_1" > 0.0) THEN ln(arg_max_cte."Proba_1") ELSE -1.79769313486231e+308 END AS "LogProba_1", CASE WHEN (arg_max_cte."Proba_2" IS NULL OR arg_max_cte."Proba_2" > 0.0) THEN ln(arg_max_cte."Proba_2") ELSE -1.79769313486231e+308 END AS "LogProba_2", CASE WHEN (arg_max_cte."Proba_3" IS NULL OR arg_max_cte."Proba_3" > 0.0) THEN ln(arg_max_cte."Proba_3") ELSE -1.79769313486231e+308 END AS "LogProba_3", arg_max_cte."arg_max_Score" AS "Decision" 
FROM arg_max_cte